import React, { Component } from 'react';
import './App.css';
import * as d3 from 'd3'

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      originalData: []
    }
    this.parse = this.parse.bind(this)
  }
  componentDidMount() {
    let svg = d3.select('body')
      .append('svg')
        .attr('width', 300)
        .attr('height', 150)
    d3.csv("data/weekly_in_situ_co2_mlo.csv").then(data => {
      data.forEach(function(d) {
        d.date = d3.timeParse("%Y-%m-%d")(d.date)
        d.level = +d.value
      })
      console.log(typeof data[0]['level'])
      this.setState({
        originalData: data
      }, () => this.parse(this.state.originalData))
    })
  }
  render() {
    return (
      <div className="App">
      </div>
    )
  }
}

export default App;
